import React from 'react';
import {
  Routes,
  Route,
} from "react-router-dom";
import { Layout } from './layout/layout';
import Main from './pages/main/mainPage';

const RoutesSPA = () => {
  return (
    <>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<Main />} />
        </Route>
      </Routes>
    </>
  );
}

export default RoutesSPA
